// export default Home;
import React from "react";

function Home() {
  return (
    <div style={styles.container}>
      <div style={styles.overlay}>
        <div style={styles.content}>
          <h1 style={styles.title}>Welcome to DocStamp!</h1>
          <p style={styles.description}>
            Manage, upload, and securely stamp your documents with ease.
          </p>
          <div style={styles.buttonContainer}>
            <button style={styles.button}>Register</button>
            <button style={styles.button}>Login</button>
          </div>
        </div>
      </div>
    </div>
  );
}

const styles = {
  container: {
    height: "100vh", // Full screen height
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    backgroundImage:
      "url('https://plus.unsplash.com/premium_photo-1661549683908-b11e9855c469?w=500&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8NXx8ZG9jdW1lbnQlMjBzdGFtcGluZ3xlbnwwfHwwfHx8MA%3D%3D')",
    backgroundSize: "cover",
    backgroundPosition: "center",
    color: "#fff", // White text color
  },
  overlay: {
    position: "absolute",
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    backgroundColor: "rgba(0, 0, 0, 0.5)", // Dark overlay for contrast
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    padding: "20px",
  },
  content: {
    textAlign: "center",
    color: "#fff",
    fontFamily: "Arial, sans-serif",
    maxWidth: "600px",
    width: "100%",
    padding: "20px",
    backgroundColor: "rgba(0, 0, 0, 0.6)", // Slightly darker background for readability
    borderRadius: "8px",
  },
  title: {
    fontSize: "3rem",
    marginBottom: "20px",
    fontWeight: "bold",
  },
  description: {
    fontSize: "1.2rem",
    marginBottom: "30px",
    lineHeight: "1.6",
  },
  buttonContainer: {
    display: "flex",
    justifyContent: "center",
    gap: "20px",
  },
  button: {
    padding: "1rem 2rem",
    backgroundColor: "#007BFF",
    color: "#FFF",
    border: "none",
    borderRadius: "4px",
    cursor: "pointer",
    fontSize: "1rem",
    transition: "background-color 0.3s ease",
    width: "150px", // Set width for consistency
  },
};

export default Home;
